Compute DAU for non-windows clients for the last week WITH sample AS ( SELECT os, submission_date, cardinality(merge(cast(hll AS HLL))) AS count FROM client_count_daily WHERE submission_date >= DATE_FORMAT(CURRENT_DATE - INTERVAL '7' DAY, '%Y%m%d') GROUP BY submission_date, os
) SELECT os, -- formatting date as late as possible improves performance dramatically date_parse(submission_date, '%Y%m%d') AS submission_date, count
FROM sample
WHERE count > 10 -- remove outliers AND lower(os) NOT LIKE '%windows%'
ORDER BY os, submission_date DESC Compute WAU by Channel for the last week WITH dau AS ( SELECT normalized_channel, submission_date, merge(cast(hll AS HLL)) AS hll FROM client_count_daily -- 2 days of lag, 7 days of results, and 6 days preceding for WAU WHERE submission_date > DATE_FORMAT(CURRENT_DATE - INTERVAL '15' DAY, '%Y%m%d') GROUP BY submission_date, normalized_channel
),
wau AS ( SELECT normalized_channel, submission_date, cardinality(merge(hll) OVER ( PARTITION BY normalized_channel ORDER BY submission_date ROWS BETWEEN 6 PRECEDING AND 0 FOLLOWING )) AS count FROM dau
) SELECT normalized_channel, -- formatting date as late as possible improves performance dramatically date_parse(submission_date, '%Y%m%d') AS submission_date, count
FROM wau
WHERE count > 10 -- remove outliers AND submission_date > DATE_FORMAT(CURRENT_DATE - INTERVAL '9' DAY, '%Y%m%d') -- only days that have a full WAU

